import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { FournisseurAuth } from './contextes/ContexteAuth';
import { FournisseurPanier } from './contextes/ContextePanier';
import BarreNavigation from './components/BarreNavigation';
import { PageConnexion, PagePanier, PageNonTrouvee } from './components/PageDemo';
import Accueil from './pages/Accueil';
import Produits from './pages/Produits';
import Wishlist from './pages/Wishlist';
import './styles/Global.css';

function App() {
  return (
    <FournisseurAuth>
      <FournisseurPanier>
        <Router>
          <div className="App">
            <BarreNavigation />
            <main>
              <Routes>
                <Route path="/" element={<Accueil />} />
                <Route path="/produits" element={<Produits />} />
                <Route path="/wishlist" element={<Wishlist />} />
                <Route path="/connexion" element={<PageConnexion />} />
                <Route path="/panier" element={<PagePanier />} />
                <Route path="*" element={<PageNonTrouvee />} />
              </Routes>
            </main>
          </div>
        </Router>
      </FournisseurPanier>
    </FournisseurAuth>
  );
}

export default App;
